import React from 'react';
import ClubForm from './ClubForm';

function ClubDetail({ pickedClub, setRegister }) {
    return (
        <div className='w-full p-3 rounded overflow-hidden shadow-[0_2px_10px] shadow-blackA7 bg-slate-800 text-white'>
            <h1 className='text-center text-2xl mb-1'>
                {pickedClub.name} kul端b端
            </h1>
            <p className='text-sm'>
                {pickedClub.description}
            </p>

            <div className='text-center mt-6' onClick={() => setRegister(true)}>
                <button className="btn btn-success">Kaydolmak ister misin?</button>
            </div>
        </div>
    )
}

export default ClubDetail
